            login = "Ingresar"
            messageReg = "¿No tienes cuenta? ¡Registrate Ya!"
            register = "Registrase" />
          </div>
        </Route>
        <Route path='/diary' Component={Diary} />
      </Switch>
    </div>
  );
}

export default App;
